if mibBuilder.loadTexts: cienaCesModuleProtectionModeColdNotification.setDescription('This notification is sent when the protection mode of the system changes to cold. A COLD protection level is the lowest level of protection. It implies that the secondary CTM is ready to assume the function of the primary CTM but a failure causing a failover would be service impacting. The secondary CTM has been synchronized with the same software package, configuration files, etc such that it will return the same state as the previous primary CTM. The protection state of the primary CTM shall not transition from NONE to PROTECTED until the secondary CTM has completed the synchronization. In the case of a failure on the primary CTM, the secondary CTM will immediately assume primary status, finish its initialization and reboot the PSLMs. The primary CTM will reapply the configuration to the PSLMs after they have booted. Any unsaved configuration changes will NOT be lost on a failover as configuration changes are propagated to the secondary CTM configuration. To enable the device to send this notification: - cienaCesModuleAllModulesTrapState needs to be set to enabled. - cienaCesModuleProtectionModeTrapState needs to be set to enabled. The above values are set to enabled by default. Variable bindings include: cienaGlobalSeverity, cienaGlobalMacAddress, and cienaCesModuleSystemProtectionMode.')
