if mibBuilder.loadTexts: cienaCesModuleProtectionModeWarmNotification.setDescription('This notification is sent when the protection mode of the system changes to warm. This state is not supported on the 5410 platform. To enable the device to send this notification: - cienaCesModuleAllModulesTrapState needs to be set to enabled. - cienaCesModuleProtectionModeTrapState needs to be set to enabled. The above values are set to enabled by default. Variable bindings include: cienaGlobalSeverity, cienaGlobalMacAddress, and cienaCesModuleSystemProtectionMode.')
cienaCesModuleProtectionModeUnprotectedNotification = NotificationType((1, 3, 6, 1, 4, 1, 1271, 2, 2, 3, 0, 13)).setObjects(("CIENA-GLOBAL-MIB", "cienaGlobalSeverity"), ("CIENA-GLOBAL-MIB", "cienaGlobalMacAddress"), ("CIENA-CES-MODULE-MIB", "cienaCesModuleSystemProtectionMode"))
if mibBuilder.loadTexts: cienaCesModuleProtectionModeUnprotectedNotification.setStatus('current')
if mibBuilder.loadTexts: cienaCesModuleProtectionModeUnprotectedNotification.setDescription('This notification is sent when the protection mode of the system changes to unprotected. A protection level of unprotected implies that there is no secondary CTM present in the system or that the current secondary CTM is not in a state to provide any protection. In the case of the CTM failure, the primary CTM will reboot and subsequently reboot all the PSLMs, causing loss of existing switched traffic patterns. To enable the device to send this notification: - cienaCesModuleAllModulesTrapState needs to be set to enabled. - cienaCesModuleProtectionModeTrapState needs to be set to enabled. The above values are set to enabled by default. Variable bindings include: cienaGlobalSeverity, cienaGlobalMacAddress, and cienaCesModuleSystemProtectionMode.')
