if mibBuilder.loadTexts: cienaCesModuleProtectionModeHotNotification.setDescription('This notification is sent when the protection mode of the system changes to hot. A HOT protection level is the highest level of protection. It implies that the secondary CTM is ready to assume the function of the primary CTM and a failure causing a failover would NOT be service impacting. The secondary CTM has been synchronized with the same software package, configuration files, etc such that it will return the same state as the previous primary CTM. The protection state of the primary CTM shall not transition from NONE to PROTECTED until the secondary CTM has completed the synchronization. In the case of a failure on the primary CTM, the secondary CTM will immediately assume primary status, finish its initialization and audit the PSLMs. All current established traffic patterns will be maintained with a minimal loss of traffic. Any unsaved configuration changes will NOT be lost on a failover as configuration changes are propagated to the secondary CTM configuration. To enable the device to send this notification: - cienaCesModuleAllModulesTrapState needs to be set to enabled. - cienaCesModuleProtectionModeTrapState needs to be set to enabled. The above values are set to enabled by default. Variable bindings include: cienaGlobalSeverity, cienaGlobalMacAddress, and cienaCesModuleSystemProtectionMode.')
